  useColorMode,
  Button,
  Flex
} from '@chakra-ui/core'

import {HStack, VStack, Circle } from '@chakra-ui/react'

type AttributesProps = {
  attributes: any[],
  colorMode: string,
}

export class Attributes extends Component<AttributesProps> {
  render() {
    let colorMode = this.props.colorMode
    let attributes = this.props.attributes
    return (
      <Flex w="100%" justify="center" >

            <HStack key={0} w="300px" p={2} flexWrap="wrap" >
              {
                attributes.map(attribute=>{
                  return (
                    <Box mt={5} d="flex" backgroundColor={colorMode == "light"? "gray.100": "gray.700"} alignItems="baseline" className="coin-balance-content">
                      <Box color="gray.500" letterSpacing="wide" fontSize="sm" ml="2">
                        <Link className="view-nft-link" color={this.props.colorMode=="dark" ? "navajowhite": "gray"} onClick={()=>{}}>attrib</Link>
                      </Box>
                    </Box>
                  )
                })
              }
            </HStack>

      </Flex>
    )
  }
}

export default Attributes
